CREATE DATABASE IF NOT exists workcation_db;

DROP TABLE IF EXISTS campsites;

CREATE TABLE IF NOT EXISTS campsites(
   Camp_id   INT auto_increment PRIMARY KEY
  ,Name      VARCHAR(113) NOT NULL
  ,Address   VARCHAR(101) NOT NULL
  ,City      VARCHAR(33) NOT NULL
  ,Rating    VARCHAR(20) NOT NULL
  ,Website   VARCHAR(231) NOT NULL
  ,Schedule  VARCHAR(792) NOT NULL
  ,Latitude  NUMERIC  NOT NULL
  ,Longitude NUMERIC  NOT NULL
);

ALTER TABLE campsites
MODIFY Latitude DECIMAL(10,8),
MODIFY Longitude DECIMAL(11,8);

